  async getBodyMeasurement(frontImg, sideImg, height, weight, sex, dataType) {
    let gender;
    // console.log(userInfo)
    // const height = userInfo.height;
    // const weight = userInfo.weight;
    if (sex == 'false') {
      gender = 0;
    } else {
      gender = 1;
    }

    const processUrl = `${env.apiBase}/measure/photo/process`;
    const dataUrl = `${env.apiBase}/measure/photo/data`;

    const processResponse = forkJoin({
      frontImg: frontImg,
      sideImg: sideImg,
      // frontImg: this.getImageAsBase64('assets/images/front.jpg'),
      // sideImg: this.getImageAsBase64('assets/images/side.jpg'),

    }).pipe(
      // eslint-disable-next-line arrow-body-style
      mergeMap((results) => {
        return forkJoin({
          frontResponse: this.http
            .post<ProcessResponse>(processUrl, {
              photoType: 1,
              photoSrc: results.frontImg,
            })
            .pipe(take(1)),
          sideResponse: this.http
            .post<ProcessResponse>(processUrl, {
              photoType: 2,
              photoSrc: results.sideImg,
            })
            .pipe(take(1)),
        });
      }),
      map((results) => {
        // eslint-disable-next-line @typescript-eslint/quotes
        if (results.frontResponse.code !== '0') {
          throw new Error(results.frontResponse.msg);
        }
        // eslint-disable-next-line @typescript-eslint/quotes
        if (results.sideResponse.code !== '0') {
          throw new Error(results.sideResponse.msg);
        }
        return {
          frontTicket: results.frontResponse.data.ticket,
          sideTicket: results.sideResponse.data.ticket,
        };
      })
    );

    console.log("get Body measurement");
    const dataResponse = processResponse.pipe(
      mergeMap((tickets) => {
        return this.http.post<MeasureDataResponse>(dataUrl, {
          ...tickets,
          userGender: gender,
          userHeight: height,
          userWeight: weight,
          dataType: dataType,
        });
      }),
    );

    return dataResponse;
  }

  getImageAsBase64(path: string) {
    const image = new AsyncSubject<string>();
    this.http.get(path, { responseType: 'blob' }).subscribe((data) => {
      const reader = new FileReader();
      reader.onloadend = function () {
        const result = this.result.toString();
        image.next(result.split(',')[1]);
        image.complete();
      };
      reader.readAsDataURL(data);
    });
    return image.asObservable();
  }

