  getBodyMeasurementData(token, frontImg, sideImg, height, weight, sex, dataType, avatarName, email){



    console.log('getBodyMeasurementData() starts');
    const headers = new HttpHeaders({
      'Content-Type': 'application/json',
      Authorization: token,
    });

    let gender;
    if (sex == 'false') {
      gender = 0;
    } else {
      gender = 1;
    }


    const ProcessRequestFrontBody = {
      photoType: 1,
      photoSrc: frontImg.substring(23) //'',
    };

    const ProcessRequestSideBody = {
      photoType: 2,
      photoSrc: sideImg.substring(23)//''//this.removeBase64Header(sideImg),
    };
    let frontFlag = false;
    let sideFlag = false;
    const processUrl = `${env.apiBase}/measure/photo/process`;
    const dataUrl = `${env.apiBase}/measure/photo/data`;
    let frontTicket, sideTicket;


    const frontRequest$ = this.http.post<ProcessResponse>(processUrl, ProcessRequestFrontBody, { headers: headers });
    const sideRequest$ = this.http.post<ProcessResponse>(processUrl, ProcessRequestSideBody, { headers: headers });

    return frontRequest$.pipe(
      concatMap(frontResponse => {
        if (frontResponse.code !== "0") {
          console.log("Front Process Request failed");
          console.log("Status: " + frontResponse.code.toString());
          //frontFlag = true;
          return throwError("Front Process Request failed");
        } else {
          frontTicket = frontResponse.data.ticket;
          console.log("Front Process Request succeeded");
          return sideRequest$;
        }
      }),
      concatMap(sideResponse => {
        if (sideResponse.code !== "0") {
          console.log("Side Process Request failed");
          console.log("Status: " + sideResponse.code.toString());
          //sideFlag = true;
          return throwError("Side Process Request failed");
        } else {
          sideTicket = sideResponse.data.ticket;
          console.log("Side Process Request succeeded");

          const DataRequestBody = {
            frontTicket: frontTicket,
            sideTicket: sideTicket,
            userGender: gender,
            userHeight: height,
            userWeight: weight,
            dataType: dataType,
          };


          console.log("Waiting for measure data response... ");
          const response = this.http.post<MeasureDataResponse>(dataUrl, DataRequestBody, { headers: headers });
          response
            .subscribe(response =>{
            this.sizeObject = response.data.sizes;
            console.log(" this.sizeObject in data service: " + this.sizeObject);
            // this.onPostmeasureResult(response.data.frontImgSrc, response.data.sideImgSrc, response.data.sizes, weight, height, 'user', "testtest1", dataType ).subscribe(response =>{
            //   console.log("onPostmeasureResult: " + response.data);
            // })
              this.filteredData = response.data.sizes.filter(item => this.desiredSizeNames.includes(item.sizeName))
              // Transform the filtered data using sizeNameMappings
              for (const item of this.filteredData) {
                const mappedSizeName = this.sizeNameMappings[item.sizeName];
                if (mappedSizeName) {
                  this.transformedData[mappedSizeName] = item.sizeCmVal;
                }
              }
              for (const desiredSizeName of this.desiredSizeNames) {
                const mappedSizeName = this.sizeNameMappings[desiredSizeName];
                if (!this.transformedData.hasOwnProperty(mappedSizeName)) {
                  this.transformedData[mappedSizeName] = 0;
                }
              }
              if(this.sizeObject){
                let measureInfo: MeasureInfo4Upload = {
                  "user_email": email,
                  "measureName": avatarName,
                  "measureType": 1,
                  "height": height,
                  "weight": weight,
                  "frontpic": frontImg,
                  "sidepic": sideImg,
                  "sizes": JSON.stringify(this.transformedData),
                  "gender": (gender == 1)?'f':'m'
                }

                this.userService.uploadMeasurement(measureInfo). pipe(
                  catchError((error) => {
                    alert("Error Occurred when sending measure data to EasyWear server. Please try again.")
                    throw error
                    return of({data: {}, msg:error.statusText });
                  })
                )
                  .subscribe(response => {
                    console.log(response.data)
                  })
                return response;
              }
              return response;
                //if(this.onPostmeasureResult(frontImg, sideImg, JSON.stringify(response.data.sizes),  weight, height, email, avatarName, dataType))
           })

          //this.sizeObject = dataResponse;
          return response;
        }
      }))

    //return this.sizeObject;
  }

